import React from "react";
import Header from "./header";
import Footer from "./footer";
import Note from "./note";
import notes from "../notes";

function App(){
    return (
        <div>
            <Header />
            {notes.map(function createNote(noteItem){
    return (
        <Note 
            key={noteItem.key}
            titl={noteItem.title}
            conten={noteItem.content}
        />
    )
})}
            <Footer />
        </div>
    )
}

export default App;
